pragma solidity ^0.8.7;
// SPDX-License-Identifier: MIT

contract FeeCollector {
    address public owner;
    uint256 public balance;

    constructor(){
        owner = msg.sender;
        balance = 10;
    }

    receive() payable external{
        balance += msg.value;
    }



}
